import React, { useState, useEffect } from 'react';
import { Link, Outlet } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';

const UserLayout = () => {
    const [pic, setPic] = useState("https://cdn-icons-png.flaticon.com/512/3135/3135715.png");
    const [item, setItem] = useState({ name: "User" });

    useEffect(() => {
        const bootstrap = require('bootstrap');
        let dropdownElement = document.getElementById('dropdownUser1');
        if (dropdownElement) {
            new bootstrap.Dropdown(dropdownElement);
        }
    }, []);

    return (
        <div className="container-fluid">
            <div className="row flex-nowrap">
                {/* Sidebar */}
                <div className="col-auto col-md-3 col-xl-2 px-sm-2 px-0 bg-dark">
                    <div className="d-flex flex-column align-items-center align-items-sm-start px-3 pt-2 text-white min-vh-100">
                        <ul className="nav nav-pills flex-column mb-sm-auto mb-0 align-items-center align-items-sm-start">
                            <li className="nav-item">
                                <Link to="enquiries" className="nav-link align-middle px-0">
                                    <i className="fs-4 bi-house"></i> <span className="ms-1 d-none d-sm-inline">Home</span>
                                </Link>
                            </li>
                        </ul>
                        <hr />
                        {/* User Profile Dropdown */}
                        <div className="dropdown pb-4">
                            <button className="btn text-white dropdown-toggle" id="dropdownUser1" data-bs-toggle="dropdown" aria-expanded="false">
                                <img src={pic} alt="Profile" width="30" height="30" className="rounded-circle" />
                                <span className="d-none d-sm-inline mx-1">{item.name}</span>
                            </button>
                            <ul className="dropdown-menu dropdown-menu-dark text-small shadow">
                                <li><a className="dropdown-item" href="#">New project...</a></li>
                                <li><a className="dropdown-item" href="#">Settings</a></li>
                                <li><Link className="dropdown-item" to="/profile">Profile</Link></li>
                                <li><hr className="dropdown-divider" /></li>
                                <li><a className="dropdown-item" href="#">Sign out</a></li>
                            </ul>
                        </div>
                    </div>
                </div>
                {/* Content Area */}
                <div className="col p-3">
                    <Outlet />
                </div>
            </div>
        </div>
    );
};

export default UserLayout;
